// src/components/Banner.js
import React from 'react';
import './Banner.css';

const Banner = () => {
  return (
    <div className="banner">
      <h1>무슨 강의를 들을지 고민이라면? 클릭 한번으로 맞춤 강의 추천받기!</h1>
      <button className="click-here-button">Click Here!</button>
    </div>
  );
};

export default Banner;
